import React from "react";
import DeleteButton from "./Delete";
const Person = ({ searchName, persons, filteredPersons }) => {
  return (
    searchName === ""
      ? persons.map((person) => (
          <li key={person.name}>
            {person.name} {person.number}
          </li>
        ))
      : filteredPersons.map((person) => (
          <li key={person.name}>
            {person.name} {person.number}
          </li>
        )),
    (<DeleteButton></DeleteButton>)
  );
};
export default Person;
